import (
	context "context"
	fern "github.com/unions/fern"
	fernclient "github.com/unions/fern/client"
)

client := fernclient.NewClient()
response, err := client.Bigunion.Update(
	context.TODO(),
	fern.NewBigUnionFromNormalSweet(
		&fern.NormalSweet{
			Value: "value",
		},
	),
)

